import axios from "axios"
import { useState } from "react"
export default function SignUp() {
    const [form,setForm] = useState({})
    function handleChange(event){
        event.preventDefault()
        if (event.target.name === "username") {
            setForm(prevForm => { return   { ...prevForm, username : event.target.value } })
        }
        if (event.target.name ==="email") {
            setForm(prevForm => { return { ...prevForm, email : event.target.value }})
        }
        if (event.target.name === "pass") {
            setForm(prevForm=> { return { ...prevForm, password : event.target.value }})
        }
        if (event.target.name === "pass2") {
            setForm(prevForm=> { return { ...prevForm, password2 : event.target.value }})
        }
        console.log(form)
    }
    return (
        <div className="formbox">
            <form method="post">

                <div>
                    <label for="username" >Username : </label>
                    <input type={"text"} name="username" id={"userinput"} onChange={handleChange} />
                </div>

                <div>
                    <label for="email" >Email : </label>
                    <input name="email" type={"email"} id={"emailinput"} onChange={handleChange} />
                </div>

                <div>
                    <label for="pass" >Password :</label>
                    <input name="pass" type={"password"} onChange={handleChange} />
                </div>

                <div>
                    <label for="pass2" >Confirm your password : </label>
                    <input name="pass2" type={"password"} onChange={handleChange} />
                </div>

                <button type="submit" >Signup</button>
            </form>
        </div>
    )
}
